export function getGeoLocation() {
    function onPositionRecieved(position) {}

    function positionNotRecieve(positionError) {}

    if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(
            onPositionRecieved,
            positionNotRecieve
        );
    }
}
